import React from "react";
import {Link} from 'react-router-dom';
import { Button } from 'semantic-ui-react';

const Home = () => {
    return (
        <div>
            <img src="https://upload.wikimedia.org/wikipedia/commons/3/38/Stranger_Things_logo.png"></img>
            <h1 id="header">Welcome to Stranger Things! This is your one stop shop to buy or sell all used items!</h1>
                <h3 id='header'>Don't have an account yet? You'll need one to be able to create a post!</h3>
            <Button class= "ui" id='header'>
            <Link to='/register'>Register Here</Link>
            </Button>
            </div>
            
        
        
    )
}

export default Home;
